    <style>
        body {
            margin: 0;
        }

        header {
            height: var(--header-height);
            background-color: #0B1520;
            display: flex;
            justify-content: center;
        }

        header .container {
            width: 100%;
            max-width: 1440px;
            padding: 16px;
        }

        main .container {
            display: flex;
            flex-direction: column;
            align-items: center;
            min-height: 100vh;
            background-image: url('bg.svg');
            background-repeat: no-repeat;
            background-size: cover;
            background-position: 0 0;
            background-color: #0B1520;
            padding-left: 16px;
            padding-right: 16px;
        }

        .title {
            font-family: Orbitron;
            font-size: 48px;
            font-weight: 600;
            line-height: 67.2px;
            letter-spacing: 0.04em;
            text-underline-position: from-font;
            text-decoration-skip-ink: none;
            margin: 0 0 24px;
            text-align: center;
            color: rgba(237, 226, 48, 1);
            text-transform: uppercase;
            padding-top: 100px;
        }

        .subtitle {
            font-family: Play;
            font-size: 18px;
            font-weight: 400;
            line-height: 25.2px;
            letter-spacing: 0.04em;
            text-align: center;
            text-underline-position: from-font;
            text-decoration-skip-ink: none;
            color: rgba(242, 242, 242, 1);
            max-width: 670px;
            text-transform: uppercase;
            margin-bottom: 70px;
        }

        .drone-image {
            max-width: 100%;
        }

        .hs-container {
            width: 100%;
            max-width: 700px;
            margin-bottom: 70px;
            min-height: 800px;
        }

        @media screen and (max-width: 1023.98px) {
            .title {
                padding-top: 60px;
                font-size: 32px;
                line-height: 1.2;
            }

            .subtitle {
                font-size: 16px;
                font-weight: 400;
                line-height: 1.2;
                margin-bottom: 40px;
            }
        }
    </style>
